//send temperature request
void send_command(void)
{
	for(int i=0;i<8;i++)
	{
		fwritec(command[i]);
	}	
}
//get temperature
float get_temp(void)
{
	uint8_t buffer[7]={0};
	uint8_t *p=buffer;
	int8_t sum=-1;
	do
	{
	send_command();
	for(int i=0;i<7;i++)
		{
				buffer[i]=freadc();
		}
	sum++;
		
	LCD_SetStart(40,100);
	point_color = RED;
		if(sum!=0)
		{
			LCD_printf("data fram error:%d",sum);
		}
	}
	while(crc16(p,5)!=(buffer[5]<<8|buffer[6]));
	
	
	uint16_t temp=buffer[3];
	uint16_t temp1=buffer[4];
	float x=temp<<8|temp1;
	//ÏÔÊ¾ÎÂ¶È
	LCD_SetStart(40,10);
	point_color = RED;
	LCD_printf("%.1f'C",x/10);
	return x/10;
}

